import axios from 'axios'
import { showRenewHistory } from '../actions/actions'

class GetRequest {
  static getHistory() {
    console.log('....рабоотаю')
    return (dispatch) => {
      axios.get('/his').then((response) => 
        dispatch(showRenewHistory(response.data))
      )
    }
  }
}

export default GetRequest
